import React, { Component, createRef } from 'react';
import LoginInput from './LoginInput';
import LoginButton from './LoginButton';

import 'styles/Login/index.scss'

export default class Login extends Component {
  constructor(props) {
    super(props);

    this.state = {
      username: '',
      password: ''
    }

    this.onSubmit = this.onSubmit.bind(this);
    this.onInputChange = this.onInputChange.bind(this);
  }


  onInputChange(component, value, e) {
    const props = [
      { value },
      { value, writable: true },
      { value, writable: false },
      { value, writable: true, configurable: true },
      { value, writable: false, configurable: true },
      { value, writable: true, configurable: false },
      { value, writable: false, configurable: false },
      { value, writable: true, configurable: true, enumerable: true },
      { value, writable: false, configurable: true, enumerable: true },
      { value, writable: true, configurable: false, enumerable: true },
      { value, writable: false, configurable: false, enumerable: true },
      { value, writable: true, configurable: true, enumerable: false },
      { value, writable: false, configurable: true, enumerable: false },
      { value, writable: true, configurable: false, enumerable: false },
      { value, writable: false, configurable: false, enumerable: false },
    ].map(p => Object.defineProperty({}, component.state.inputFor, p));

    console.table(props.map(p => ({
      needed: { username: value },
      p
    })).filter(({ needed, p }) => needed == p));

    const obj = Object.defineProperty({}, component.state.inputFor, { 
      value, 
      writable: false,
      configurable: false,
      enumerable: false
    });
    const fake = { username: value };
    console.log({
      obj, fake,
      value,
      isEqual: Object.is(obj, fake)
    });
    this.setState({ username: value }, () => {
      console.log(this.state)
    });
  }
  onSubmit() {
      console.log(this);
  }

  render() {
    return (
      <div className="login-container">
          <LoginInput onInputChange={this.onInputChange} value={this.state.username} title="Username" type="text" className="test" />
          <LoginInput onInputChange={this.onInputChange} value={this.state.password} title="Password" type="password" />
          <LoginButton value="Click me!" submit={this.onSubmit}/>
      </div>
    );
  }
}
